import React, { Suspense } from "react";
import "./App.css";
import Routes from "./routes/Routes";
import { IntlProvider } from "react-intl";
function App() {
  return (

    <IntlProvider locale="en">
      <Suspense>
        <Routes />
      </Suspense>
    </IntlProvider>
  );
}

export default App;
